def minSteps(n):
    if n == 1:
        return 0
    elif n == 2:
        return 2
    elif n == 3:
        return 3
    elif n == 4:
        return 3
    else:
        dp = [0, 0, 1, 2]
        for i in range(4, n):
            dp.append(dp[-1] + dp[-2] + 1)
        return dp[-1]

